import React from "react";
import "../components/css/About.css";

const OtherProjects: React.FC = () => {
  return (
    <section className="bg-[#F4F1EC] px-8 py-16 font-serif text-black">
      <div className="max-w-6xl mx-auto">
        <div className="mt-0 md:-mt-10">
          <div className="h-[1px] w-full max-w-[300px] bg-gray-300 mb-8" />
          <h2 className="about-title">Other Projects</h2>
        </div>

        <img 
          src="/images/other-projects.png" 
          alt="Other Projects - Brand Design, Web Game, and NFT World" 
          className="w-full max-w-4xl mx-auto mt-16"
        />

        <div className="flex justify-center mt-12 mb-8">
          <button className="bg-[#B2FFFF] text-black border border-black rounded-full px-8 py-3 font-serif text-sm font-medium transition-all duration-300 ease-in-out hover:-translate-y-1 hover:shadow-[0_4px_0_0_#000000] active:translate-y-0 active:shadow-[0_1px_0_0_#000000]">
            VIEW ALL PROJECTS
          </button>
        </div>
      </div>
    </section>
  );
};

export default OtherProjects;
